$(document).ready(function(){
	// disable auto discover
	Dropzone.autoDiscover = false;
 
	// grap our upload form by its id
	$("#new_upload").dropzone({
		// restrict image size to a maximum 1MB
		maxFilesize: 1,
		// changed the passed param to one accepted by
		// our rails app
		paramName: "upload[image]",
		// show remove links on each image upload
		addRemoveLinks: true,
		// if the upload was successful
		success: function(file, response){
			// find the remove button link of the uploaded file and give it an id
			// based of the fileID response from the server
			$(file.previewTemplate).find('.dz-remove').attr('id', response.fileID);
			newone = '<input type="hidden" value="'+response.fileID+'" name="upload">';
			oldlist = $('#attachments').html();
			$('#attachments').html(oldlist+newone);
			
			// add the dz-success class (the green tick sign)
			$(file.previewElement).addClass("dz-success");
		},
		
	
		//when the remove button is clicked
		removedfile: function(file){
			// grap the id of the uploaded file we set earlier
			var id = $(file.previewTemplate).find('.dz-remove').attr('id'); 
 
			// make a DELETE ajax request to delete the file
			$.ajax({
				type: 'DELETE',
				url: '/uploads/' + id,
				success: function(data){
					console.log(data.message);
					var selector = "a[id^='"+id+"']";
					$(selector).parent('div.dz-preview.dz-processing.dz-image-preview.dz-success').fadeOut();
					newone = '<input value="'+id+'" name="upload" type="hidden">';
					oldlist = $('#attachments').html();
					newlist = oldlist.replace(newone,'');
					$('#attachments').html(newlist);
				}
			});
		}
	});	
});
